import React, { useState } from 'react';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Entity from './components/Entity';
import Sentimentscore from './components/Sentimentscore';
import News from './components/News';
import NewsBox from './components/News/newsbox';
import Entityvisuals from './components/entityvisuals';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <Entity/>
        <Sentimentscore/>
        <Sidebar/>
        <Entityvisuals/>
        <News/>
        <div>
      <NewsBox
        sentimentScore={0.75}
        newsHeader="Stock Market Hits All-Time High"
        newsContent="The stock market has reached an all-time high as investors remain optimistic about future growth."
      />
      <NewsBox
        sentimentScore={-0.5}
        newsHeader="Government Faces Criticism Over New Policy"
        newsContent="The new government policy has sparked a wave of criticism, with many arguing it will harm the economy."
      />
      <NewsBox
        sentimentScore={0}
        newsHeader="Tech Industry Faces Mixed Reviews"
        newsContent="The latest reports suggest that the tech industry is facing a mixed set of reviews from analysts, with some optimistic and others concerned."
      />
    </div>
      </header>
    </div>
  );
}

export default App;
